INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 401, "2030/12/17 14:59:59", 0.0, 102301, "2020/07/31 12:00:00", "アヤネ", 24001, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, 402, "2030/12/17 14:59:59", 0.0, 102301, "2020/07/31 12:00:00", "アヤネ", 24002, 2.21);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 403, "2030/12/17 14:59:59", 0.0, 102301, "2020/07/31 12:00:00", "アヤネ", 24003, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, 701, "2030/12/17 14:59:59", 0.0, 192201, "2020/07/31 12:00:00", "アサヒ", 24004, 1.99);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, 702, "2030/12/17 14:59:59", 0.0, 192201, "2020/07/31 12:00:00", "アサヒ", 24005, 2.21);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, 703, "2030/12/17 14:59:59", 0.0, 192201, "2020/07/31 12:00:00", "アサヒ", 24006, 3.33);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 801, "2030/12/17 14:59:59", 0.0, 192301, "2020/07/31 12:00:00", "部員３", 24007, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, 802, "2030/12/17 14:59:59", 0.0, 192301, "2020/07/31 12:00:00", "部員３", 24008, 2.68);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 803, "2030/12/17 14:59:59", 0.0, 192301, "2020/07/31 12:00:00", "部員３", 24009, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "やった！", 1, 501, "2030/12/17 14:59:59", 0.0, 192501, "2020/07/31 12:00:00", "", 24010, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "勝ったよ！", 1, 502, "2030/12/17 14:59:59", 0.0, 192501, "2020/07/31 12:00:00", "", 24011, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "いい調子！", 1, 503, "2030/12/17 14:59:59", 0.0, 192501, "2020/07/31 12:00:00", "", 24012, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 6, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, 111, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", "ミサト", 24013, 5.33);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, 112, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", "ミサト", 24014, 6.85);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, 113, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", "ミサト", 24015, 3.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, 611, "2030/12/17 14:59:59", 0.0, 192401, "2020/07/31 12:00:00", "ダイチ", 24016, 6.11);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, 612, "2030/12/17 14:59:59", 0.0, 192401, "2020/07/31 12:00:00", "ダイチ", 24017, 6.75);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 613, "2030/12/17 14:59:59", 0.0, 192401, "2020/07/31 12:00:00", "ダイチ", 24018, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, 211, "2030/12/17 14:59:59", 0.0, 113401, "2020/07/31 12:00:00", "ハツネ", 24019, 4.52);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, 212, "2030/12/17 14:59:59", 0.0, 113401, "2020/07/31 12:00:00", "ハツネ", 24020, 3.89);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, 213, "2030/12/17 14:59:59", 0.0, 113401, "2020/07/31 12:00:00", "ハツネ", 24021, 13.49);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, 311, "2030/12/17 14:59:59", 0.0, 106501, "2020/07/31 12:00:00", "カヤ", 24022, 3.17);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, 312, "2030/12/17 14:59:59", 0.0, 106501, "2020/07/31 12:00:00", "カヤ", 24023, 4.42);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 6, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, 313, "2030/12/17 14:59:59", 0.0, 106501, "2020/07/31 12:00:00", "カヤ", 24024, 2.89);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 4, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, 421, "2030/12/17 14:59:59", 0.0, 102301, "2020/07/31 12:00:00", "アヤネ", 24025, 3.71);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 2, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, 721, "2030/12/17 14:59:59", 0.0, 192201, "2020/07/31 12:00:00", "アサヒ", 24026, 5.1);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, 821, "2030/12/17 14:59:59", 0.0, 192301, "2020/07/31 12:00:00", "部員３", 24027, 4.34);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (0.0, 24, 10046, 1, "いい勝負だったよ\nまたやろうね", 1, 521, "2030/12/17 14:59:59", 0.0, 192501, "2020/07/31 12:00:00", "", 24028, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 24, 10046, 1, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, 101, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", "ミサト", 24029, 5.62);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 24, 10046, 1, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, 102, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", "ミサト", 24030, 9.58);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 24, 10046, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 103, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", "ミサト", 24031, 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 24, 10046, 2, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, 104, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", "ミサト", 24032, 9.13);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (-360.0, 24, 10046, 1, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, 105, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", "ミサト", 24033, 8.27);
